description:
Farm for your Life - The Zombie flavored farming game

Your community was taken down by a heavy storm which caused an apocalypse and unleashed the living dead. Together with the other survivors, it is your task to rebuild and to allow that sustainable life can still be assured. Cultivate your farm and manage your restaurant to provide food and deal with all the zombies.
It's a strange Time Management Game. The lightheartedness of a casual game collides with elements, which are usually only seen in horror genres. Discover the contrast, which takes both genres for a wild ride.

The installer is pre-cracked. It may show up as spyware but there is NO extra added adware, virus, or spyware. 
